import React from "react";
import { Col, Row } from "react-bootstrap";

const NewMain = () => {
    return(
        <>
         {/* New Main Part */}
         <div>
          <Row>

              <Col>1st Column</Col>
              <Col> 2nd Column</Col>
          </Row>
          </div>
        </>
    )
}
export default NewMain
